import React from 'react';
import { motion } from 'framer-motion';

const Projects = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: [0.22, 1, 0.36, 1] }
  };

  const projects = [
    {
      title: "Healthcare AI Diagnostic System",
      tools: ["Python", "TensorFlow", "FastAPI", "React", "Docker"],
      date: "2023",
      description: "Developed a deep learning-based diagnostic system for medical image analysis. The system achieves 95% accuracy in detecting abnormalities and has been deployed in multiple healthcare facilities.",
      image: "/images/project-healthcare.jpg"
    },
    {
      title: "Financial Market Predictor",
      tools: ["Python", "PyTorch", "Pandas", "Scikit-learn", "Streamlit"],
      date: "2022",
      description: "Built a machine learning model for predicting market trends using historical data and sentiment analysis. Implemented real-time data processing and interactive visualization dashboard.",
      image: "/images/project-finance.jpg"
    },
    {
      title: "Smart City Traffic Analysis",
      tools: ["Python", "OpenCV", "TensorFlow", "MongoDB", "Docker"],
      date: "2022",
      description: "Created a computer vision system for real-time traffic monitoring and analysis. The system provides insights for traffic optimization and urban planning.",
      image: "/images/project-traffic.jpg"
    },
    {
      title: "NLP-Powered Document Analyzer",
      tools: ["Python", "BERT", "spaCy", "FastAPI", "React"],
      date: "2021",
      description: "Developed an automated document processing system using natural language processing. The system extracts key information and classifies documents with 90% accuracy.",
      image: "/images/project-nlp.jpg"
    }
  ];

  return (
    <section id="projects" className="section">
      <motion.div
        initial="initial"
        whileInView="animate"
        viewport={{ once: true }}
        variants={{
          animate: { transition: { staggerChildren: 0.1 } }
        }}
      >
        <motion.h2 
          variants={fadeIn}
          className="text-h2 text-text mb-8"
        >
          Projects
        </motion.h2>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {projects.map((project, index) => (
            <motion.div
              key={index}
              variants={fadeIn}
              className="bg-background-dark rounded-xl overflow-hidden"
            >
              <div 
                className="h-48 bg-cover bg-center"
                style={{ backgroundImage: `url(${project.image})` }}
              />
              <div className="p-6">
                <div className="flex justify-between items-start mb-4">
                  <h3 className="text-h3 text-text">{project.title}</h3>
                  <span className="text-small text-text-light">{project.date}</span>
                </div>
                
                <p className="text-body text-text-light mb-4">
                  {project.description}
                </p>

                <div className="flex flex-wrap gap-2">
                  {project.tools.map((tool, idx) => (
                    <span
                      key={idx}
                      className="px-3 py-1 bg-background text-text-light rounded-full text-small"
                    >
                      {tool}
                    </span>
                  ))}
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </section>
  );
};

export default Projects;
